import React, { useEffect } from "react";
import Link from "next/Link";

function Page() {
  return (
    <>
      <h1>All notes here</h1>

      <Link href="/notes/[id]" as={`/notes/1`}>
        <a>Click on Notes</a>
      </Link>
    </>
  );
}

export default Page;
